import InputBox from 'components/InputBox';
import { useState } from 'react';
import './App.css';

function App() {
  const [value, setValue] = useState<string>('');

  return (
    <>
      <InputBox
        label="이메일"
        type="text"
        placeholder="이메일 주소를 입력하세요"
        value={value}
        error={false}
        setValue={setValue}
        message="aaa"
      />
    </>
  );
}

export default App;
